import React from 'react';
import { NavLink } from 'react-router-dom';

const Navigation = () => {
    return (
        <nav>
            <NavLink 
                to='/work'
                className={({ isActive }) => isActive ? 'active-nav' : 'nav'}
            >work</NavLink>
            <NavLink 
                to='/play'
                className={({ isActive }) => isActive ? 'active-nav' : 'nav'}
            >play</NavLink>
            <NavLink 
                to='/about'
                className={({ isActive }) => isActive ? 'active-nav' : 'nav'}
            >about</NavLink>
        </nav>
    );
};

export default Navigation;
